import{_ as s,c as o,a4 as a,o as t}from"./chunks/framework.CyeRpf1z.js";const l="/ps/ps-01.png",i="/ps/ps-02.png",e="/ps/ps-03.png",c="/ps/ps-04.png",r="/ps/ps-05.png",n="/ps/ps-06.png",d="/ps/ps-07.png",m="/ps/ps-08.png",g="/ps/ps-09.png",h="/ps/ps-10.png",_="/ps/ps-11.png",u="/ps/ps-12.png",b="/ps/ps-13.png",k="/ps/ps-14.png",y="/ps/ps-15.png",v="/ps/ps-16.png",f="/ps/ps-17.png",w="/ps/ps-18.png",z="/ps/ps-19.png",P="/ps/ps-20.png",q="/ps/ps-21.png",x="/ps/ps-22.png",S="/ps/ps-23.png",D="/ps/ps-24.png",C="/ps/ps-25.png",I="/ps/ps-26.png",W=JSON.parse('{"title":"Photoshop 2023无法安装","description":"","frontmatter":{},"headers":[],"relativePath":"yiov/computer/ps.md","filePath":"yiov/computer/ps.md","lastUpdated":1734431113000}'),O={name:"yiov/computer/ps.md"};function N(R,p,T,$,B,H){return t(),o("div",null,p[0]||(p[0]=[a('<h1 id="photoshop-2023无法安装" tabindex="-1">Photoshop 2023无法安装 <a class="header-anchor" href="#photoshop-2023无法安装" aria-label="Permalink to &quot;Photoshop 2023无法安装&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">(当前界面文档来自yiov.top)</p><ul><li><a href="https://yiov.top/" target="_blank" rel="noreferrer">yiov</a>「伊奥&#39;s 教程集」</li></ul></div><h2 id="起因" tabindex="-1">起因 <a class="header-anchor" href="#起因" aria-label="Permalink to &quot;起因&quot;">​</a></h2><p>给公司电脑安装ps 2023，结果报错</p><p>操作系统不满足此安装程序的最低系统要求，{0}是安装所需的最低版本。(错误代码:21)</p><p><img src="'+l+'" alt="" loading="lazy"></p><p>根据 <a href="https://helpx.adobe.com/cn/photoshop/system-requirements.chromeless.html" target="_blank" rel="noreferrer">官网的配置要求</a> 来看，系统确实没有达到要求</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>更早其他ps版本，<a href="https://helpx.adobe.com/cn/photoshop/system-requirements/earlier-versions.chromeless.html" target="_blank" rel="noreferrer">点我查看</a></p></div><p><img src="'+i+'" alt="" loading="lazy"></p><p><img src="'+e+'" alt="" loading="lazy"></p><p>我原本的系统为 <code>1809</code>，配置要求需要 <code>20H2</code>，更新系统也没解决</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p><code>win键+R键</code>调出cmd，输入 <code>winver</code> 即可查询系统版本</p></div><h2 id="解决" tabindex="-1">解决 <a class="header-anchor" href="#解决" aria-label="Permalink to &quot;解决&quot;">​</a></h2><p>于是在CSDN参考了 <a href="https://blog.csdn.net/leitingvre" target="_blank" rel="noreferrer">@大心匠</a> 的文章，解决了问题</p><ul><li><a href="https://blog.csdn.net/leitingvre/article/details/123267644" target="_blank" rel="noreferrer">安装Photoshop 2022时出现操作系统不满足此安装程序的最低系统要求</a></li></ul><h3 id="media-creation-tool" tabindex="-1">Media Creation Tool <a class="header-anchor" href="#media-creation-tool" aria-label="Permalink to &quot;Media Creation Tool&quot;">​</a></h3><p>直接上微软的官网下载 <a href="https://www.microsoft.com/zh-cn/software-download/windows10/" target="_blank" rel="noreferrer">Media Creation Tool</a></p><p><img src="'+c+'" alt="" loading="lazy"></p><h3 id="iso文件" tabindex="-1">ISO文件 <a class="header-anchor" href="#iso文件" aria-label="Permalink to &quot;ISO文件&quot;">​</a></h3><p>下载完成后打开，接受声明</p><p><img src="'+r+'" alt="" loading="lazy"></p><p>选 <code>为另一台电脑创建安装介质</code></p><p><img src="'+n+'" alt="" loading="lazy"></p><p>这里我选择 ISO 文件</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>如果你要用PE启动盘安装，就选第1个</p><p>否则就和我一样，本地安装</p></div><p><img src="'+d+'" alt="" loading="lazy"></p><p>选择一个位置存放ISO文件，我直接放到了H盘</p><p><img src="'+m+'" alt="" loading="lazy"></p><p>接下来就是等下载完成了，镜像文件大概4.5G左右</p><p><img src="'+g+'" alt="" loading="lazy"></p><p>下载完成还要等他完成验证，就可以了</p><p><img src="'+h+'" alt="" loading="lazy"></p><p>如果有在自动清理，等一会就好，不要急</p><p><img src="'+_+'" alt="" loading="lazy"></p><h3 id="安装系统" tabindex="-1">安装系统 <a class="header-anchor" href="#安装系统" aria-label="Permalink to &quot;安装系统&quot;">​</a></h3><p>双击打开下载好的ISO文件，然后再双击 <code>setup.exe</code></p><p><img src="'+u+'" alt="" loading="lazy"></p><p><img src="'+b+'" alt="" loading="lazy"></p><p>win10的安装程序就出来了，直接下一步</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>如果你想取消win系统自动更新，先点 <code>更改windows安装程序下载更新的方式</code>，不是现在即可</p></div><p><img src="'+k+'" alt="" loading="lazy"></p><p>由于公司电脑是卖电脑的安装的，这里的激活码并不是真的，而是破解版</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>真密钥ID是没有数字0的</p></div><p><img src="'+y+'" alt="" loading="lazy"></p><p>现在没有密钥就无法下一步了</p><div class="warning custom-block"><p class="custom-block-title">注意</p><p>如果你本身就是正版软件，就不会弹这个窗口</p></div><p><img src="'+v+'" alt="" loading="lazy"></p><p>百度随便找了个企业版激活码：<code>NPPR9-FWDCX-D2C8J-H872K-2YT43</code></p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>想要真实的windows密钥，可以去</p><p>爱好论坛：<a href="https://www.aihao.cc/" target="_blank" rel="noreferrer">https://www.aihao.cc/</a></p></div><p><img src="'+f+'" alt="" loading="lazy"></p><p>接受条款，下一步</p><p><img src="'+w+'" alt="" loading="lazy"></p><p><img src="'+z+'" alt="" loading="lazy"></p><p>漫长的等待时间后，开始安装</p><p><img src="'+P+'" alt="" loading="lazy"></p><p>不出意外，意外就来了，报错的是雷电模拟器，卸载了再装就是</p><div class="warning custom-block"><p class="custom-block-title">报错</p><p>VirtualBox (LDPlayer)</p><p>立即卸载此应用，因为它与 Windows 10 不兼容</p></div><p><img src="'+q+'" alt="" loading="lazy"></p><p>手动卸载了，刷新就可以装了</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>如果你不想保留应用和文件，可以更改</p></div><p><img src="'+x+'" alt="" loading="lazy"></p><p>然后电脑就开始安装了，等吧，要好久好久好久...</p><p><img src="'+S+'" alt="" loading="lazy"></p><p>安装完成进入桌面，我们查一下版本</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p><code>win键+R键</code>调出cmd，输入 <code>winver</code> 即可查询系统版本</p></div><p><img src="'+D+'" alt="" loading="lazy"></p><h3 id="再装ps" tabindex="-1">再装PS <a class="header-anchor" href="#再装ps" aria-label="Permalink to &quot;再装PS&quot;">​</a></h3><p>再次安装ps，成功装上，完美运行</p><p><img src="'+C+'" alt="" loading="lazy"></p><p><img src="'+I+'" alt="" loading="lazy"></p><h2 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h2><details class="details custom-block"><summary>自定义形状中追加默认形状后无法删除</summary><p>窗口 - 形状，然后右侧的小窗口就可以删除了，可以导入自己喜欢的形状，格式是 <code>.csh</code></p></details><details class="details custom-block"><summary>Ps一直弹窗，怎么禁用联网</summary><p>win+R键 - control - Windows Defender 防火墙 - 高级设置 - 出站规则 - 新建规则 - 程序 选择Ps所在文件夹的exe程序 - 阻止，下一步直到完成</p></details>',73)]))}const E=s(O,[["render",N]]);export{W as __pageData,E as default};
